.
1. Started with Atkins to transition me into a low carb life and wean myself off of carbs.~1 month with exercise.
2. Heard about keto- did an insane amount of research on it and decided that processed foods and sugar alcohols weren‚Äôt for me so I started removing those from my life slowly.
3. Did lazy keto for 7 months (no macro tracking, keep under 20g net carbs, clean eating).
4. In November I had been stalled for 3 months so I did a DietBet with "Mols Weightloss Transformation" started macro tracking and intermittent fasting.
5. Gradually transitioned my fasting to OMAD (one meal a day by January/Feb).
6. Hit my goal weight in February of 160lb (I‚Äôm 5‚Äô9‚Äù)
7. Exercise 3-4 days per week the entire time.
8. I went off keto for every vacation (4 total) and went back to keto when I returned.
9. Did bulletproof coffee for like 2 weeks otherwise I drink black coffee.
10. Never chased ketone readings- always knew by how I felt if I was in ketosis or not (no appetite, focus, energy, brain fog gone, decreased bloat and inflammation).
11. Used Pinterest and google for all my keto recipes, never bought a cookbook until a few months ago.
12. Supplement with vitamins the entire time.
13. Use "Ultima Replenisher" for electrolyte replacements.
14. Drink apple cider vinegar and aloe Vera whole leaf juice every night.
15. Realize that it is a life long decision to be healthy, it‚Äôs not an overnight fix.
.
This took time, it took hard work, it took dedication. I wasn‚Äôt always motivated but I was determined.
.
